import React from 'react';
import { Switch } from 'react-router-dom';

const App = () => {
  return (
    <div>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route exact path="/project-1" component={portfolio} />
        <Route exact path="/" component={Home} />
      </Switch>
    </div>
  );
};

export default App;
